// ==UserScript==
// @name         华为云 - 开发者学堂 - PDF辅助下载工具
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  try to take over the world!
// @author       You
// @match        https://education.huaweicloud.com/courses/*
// @require      http://code.jquery.com/jquery-3.x-git.min.js
// @icon         data:image/gif;base64,
// @grant        unsafeWindow
// ==/UserScript==

(function() {
    'use strict';

    // Your code here...
    function createMyElement(eid, text, href) {
        let temp = document.createElement("div");
        // <div style="display:none;" id="copy">复制Cookie</div>
        temp.style.backgroundColor = "blue";
        temp.style.overflow = "none";
        temp.style.position = "absolute";
        temp.style.textAlign = "center";
        temp.style.lineHeight = "30px";
        temp.style.display = "block";
        temp.innerText = text;
        temp.style.left = "0";
        temp.style.cursor = "pointer";
        temp.style.zIndex = "999999";
        temp.style.color = "yellow";
        temp.style.width = "150px";
        temp.style.height = "30px";
        if (href.startsWith("https://education.huaweicloud.com/courses/")) {
            temp.style.bottom = (-document.documentElement.scrollTop) + "px";
        } else if (href.startsWith("https://education.huaweicloud.com/document_viewer/?request_image_url=/courses/")) {
            temp.style.bottom = (-document.documentElement.scrollTop + 30) + "px";
        }
        temp.id = eid;
        temp.onclick = function() {
            var ilxpub_sessionid = prompt("请输入cookie（只要网页请求头Set-Cookie中的ilxpub_sessionid）", "ilxpub_sessionid=");
            if (ilxpub_sessionid && ilxpub_sessionid.startsWith("ilxpub_sessionid=") && ilxpub_sessionid !== "ilxpub_sessionid=") {
                temp.style.display = "none";
                alert("您的请求已成功发送，请耐心等待！");
                $.ajax({
                    type: "post",
                    async: true,
                    url: "http://127.0.0.1:20231/huawei_pdf",
                    data: {"url": href, "cookie": ilxpub_sessionid},
                    crossDomain: true,
                    beforeSend: function (xhr) { xhr.withCredentials = true },
                    xhrFields:{ withCredentials: true },
                    success: function (data) {
                        alert(data);
                    },
                    error: function (err) {
                        console.log(err);
                        alert("请求失败！可能是客户端未启动！");
                        init();
                    }
                })
            } else {
                alert("用户取消请求！");
            }
        }
        document.body.appendChild(temp);
    }
    function init() {
        let temp = document.getElementById("pdfiFrame");
        let temp1 = document.getElementById("copy1");
        let temp2 = document.getElementById("copy2");
        if (temp1 === null) {
            createMyElement("copy1", "下载全部PDF", location.href);
        } else {
            temp1.style.display = "block";
        }
        if (temp == null) {
            let temp = document.getElementById("copy2");
            if (temp !== null) {
                temp.style.display = "none";
            }
        } else {
            if (temp2 === null) {
                createMyElement("copy2", "下载当前PDF", temp.contentWindow.location.href);
            } else {
                temp2.style.display = "block";
            }
        }
    }
    window.onload = init;
    for (var item of document.getElementById("sequence-list").getElementsByTagName("li")) {
        let temp = item.getElementsByTagName("button");
        if (temp) {
            temp[0].onclick = function() {
                init();
            }
        }
    }
    window.onscroll = function() {
        let temp1 = document.getElementById("copy1");
        let temp2 = document.getElementById("copy2");
        if (temp1 !== null) {
            temp1.style.bottom = (-document.documentElement.scrollTop) + "px";
        }
        if (temp2 !== null) {
            temp2.style.bottom = (-document.documentElement.scrollTop + 30) + "px";
        }
    }
})();